import { useState } from "react";
import { initializeApp } from "firebase/app";
import { signOut, getAuth } from "firebase/auth";
import { Link,useNavigate } from "react-router-dom";
import axios from "axios";


function App() {
    const [data, setData] = useState([])
    const [value,setValue]=useState("")
    const [search,setSearch]=useState([])

    const navigate = useNavigate()


    const firebaseConfig = {
        apiKey: "AIzaSyA4U0Ih2TcJUWHsAo2IySYuL0BeD0qMcqo",
        authDomain: "ganesh-app-c566a.firebaseapp.com",
        projectId: "ganesh-app-c566a",
        storageBucket: "ganesh-app-c566a.appspot.com",
        messagingSenderId: "533126158425",
        appId: "1:533126158425:web:49fca895eb376cccfa7948",
        measurementId: "G-819PNHRJ64"
    };
    const app = initializeApp(firebaseConfig);
    const auth = getAuth()


    const submitData = (event) => {
        event.preventDefault()

        signOut(auth)

            .then(() => {
                alert("regestation successfull")
                navigate("/login")
            })
            .catch((err) => {
                alert("error",err)
            })


    }


    fetch("  http://localhost:3009/project")
        .then((res) => {
            return res.json()
        })
        .then((resp) => {
            setSearch(resp)
        }, [])


   
    

    const filter = (e) => {
        setSearch(data.filter(item => item.name.toLowerCase().includes(e.target.value)))
    }

     
    return (
        <div>
            <div style={{ backgroundColor: "lightblue" }}>
                <form onSubmit={search}>
                <img src="https://www.caranddriver.com/_assets/design-tokens/caranddriver/static/images/logos/logo.68b8e69.svg?primary=navLogoColor" style={{ width: "100px", height: "80px",marginLeft:"30px" }} />
                <input  onChange={filter}  style={{ marginLeft: "130px", width: "600px", height: "45px", borderRadius: "50px" }} type="text" placeholder="Search for more mustang cars" />
                
                <i style={{ marginLeft: "70px" }} class="fa-solid fa-bell fa-bounce fa-2xl"></i>
                
                <Link to="/login">
                <button style={{marginLeft:"100px"}} className="btn btn-danger">LOGOUT</button>
                </Link>
                </form>
            </div>


            <div style={{display:"flex",gap:"20px"}}>

                <div>
                    <form onSubmit={submitData} style={{backgroundColor:"lightblue",width:"330px",padding:"10px", marginTop:"40px"}}>


                            <div className="mb-3" style={{width:"300px"}}>
                                <select id="disabledSelect" class="form-select">
                                    <option>Disabled select</option>
                                </select>
                            </div>

                            <div className="mb-3" style={{width:"300px"}}>
                                <select id="disabledSelect" class="form-select">
                                    <option>Disabled select</option>
                                </select>
                            </div>

                            <div className="mb-3" style={{width:"300px"}}>
                                <select id="disabledSelect" class="form-select">
                                    <option>Disabled select</option>
                                </select>
                            </div>

                            <div className="mb-3" style={{width:"300px"}}>
                                <select id="disabledSelect" class="form-select">
                                    <option>Disabled select</option>
                                </select>
                            </div>

                            <div className="mb-3" sty le={{width:"300px"}}>
                                <select id="disabledSelect" class="form-select">
                                    <option>Disabled select</option>
                                </select>
                            </div>
                    </form>
                </div>


                <div style={{ display: "grid", gridTemplateColumns: "auto auto auto", gridGap: "20px",marginTop:"10px"}}>
                    {search.map((ourdata) => (
                        <div>
                            <div className="card" style={{ width: "250px", height: "330px", textAlign: "center"  }} >
                                <img src={ourdata.img} style={{ width: "220px", height: "200px", borderRadius: "8px", marginLeft: "14px",marginTop:"20px" }} />
                                <h4>{ourdata.name}</h4>
                                <h5>{ourdata.manufacturer}</h5>
                                <h5> ${ourdata.price}</h5>
                                <p className="btn btn-success">ADD CART</p>
                            </div>
                        </div>
                    ))}
                </div>
            </div>




        </div>
    )
}
export default App;
